import Top from "./components/Top"
import Button from "./components/Button"
import Links from './components/Links';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import About from "./About";
import { NavLink } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <div className="links">
          <ul> 
            <li> <NavLink exact className="links-active" to="/">home</NavLink> </li>
            <li> <NavLink className="links-active" to="/about">about</NavLink> </li>
          </ul>
        </div>
          <Switch> 
            <Route exact path="/"> 
              <Top/>
              <Button/>
            </Route>
            <Route path="/about"> 
              <About/>
            </Route>
          </Switch>
      </div>
    </Router>
  );
}

export default App;
